<div class="card">
  <p-menubar [model]="items">
    <ng-template #end>
            @if(token!==null && token!==''){
              <p-menubar [model]="itemUserFinalLogin"/>
            }
            @else {
              <p-menubar [model]="itemUserFinal"/>
            }
    </ng-template>
  </p-menubar>
</div>
